import React, { useEffect, useState } from 'react'
import axios from 'axios'

const App = () => {
  const [data, setdata] = useState([])
  useEffect(() => {
    const getData = async () => {
      const { data } = await axios.get('/api/data')
      setdata(data)
    }
    getData()
  }, [])
  return (
    <>
      {data.map(iter => <h1 key={iter._id}>{iter.long}-{iter.lat}</h1>)}
    </>
  )
}
export default App
